import styled from 'styled-components';

const MastheadContent = styled.div`
  position: relative;
  z-index: 100;
  width: 60%
  margin: 0 auto;
  text-align: center;
  h1 {font-size: 3rem;}
  p {font-size; 1.25rem;}
`;

export default MastheadContent;
